Story.create(name: "With the emergence of Tristan Thompson, will Kevin Love re-sign in a lesser role?", thumburl: "http://img1.imagehousing.com/17/a81fd8a91a96e7d673f57c4ac06d4447.jpg", summary: "Tristan Thompson is in for a big pay day.  Kevin Love has a player option for next year that he may opt out of to become a free agent.  This poses a problem for the Cleveland Cavaliers because both players play the same position.  Having two eight figure, multi year contracts tied up in the same position is something rarely seen today in the NBA.  Both players seem to be a part of Cleveland's future but if they want to sign both players, they won't have much cap space to fill out the rest of the roster.  Cleveland has a big decision to make on both players that will shape their future for the next several years.")

Story.create(name: "After the Bulls were eliminated, is Coach Thibs headed out the door?", thumburl: "http://img1.imagehousing.com/49/247d780509134e7fd5503dc466577b86.jpg", summary: "The Chicago Bulls have underperformed for the past several years.  Part of that is due to Derrick Rose's injury history.  The Bulls may look to make a coaching change to shake things up to try and extend their championship window.  If they do you can look at Tom Thibodeau as the front runner for the newly vacated New Orleans head coaching job.")

Story.create(name: "Spurs looking to add Lamarcus Aldridge this offseason.", thumburl: "http://img1.imagehousing.com/22/63c2f288332256b268583313070ec008.jpg", summary: "After the Spurs were bounced in the first round they will look to reload with a huge splash this offseason.  Sources say that the team is currently looking to move a player to make room for a huge contract offer to Lamarcus Aldridge.  The players they are possibly looking to move are Boris Diaw, Tiago Splitter or Patty Mills.")

Story.create(name: "Dallas implodes in playoffs, management will look to rebuild.", thumburl: "http://img1.imagehousing.com/6/2c3135e357f538e4915a5a36d20f67a5.jpg", summary: "The Rajon Rondo experiement failed and Dallas didnâ€™t get passed the first round of the playoffs for the fourth straight year.  You can expect Dallas to be highly active in the offseason to try and acquire a PG to fill the giant void at the position.  Some targets include free agent, Reggie Jackson and possibly Denver's Ty Lawson via trade.")


